import React from 'react'
import { connect } from 'react-redux'
import {
  ClassSelector
} from '../../modules'
import { 
  Modal,
  LoginForm,
} from '../../components'


const InitModal = ({appear, login, configs}) => {
	return (
		 <Modal appear={appear} close={login}>
        <hr/>
        <LoginForm/>
        <hr/>
        <p>Раса:</p>
        <hr/>
        <ClassSelector description configs={configs}/>
      </Modal>
	)
}

const ConnectedComponent = connect(mapStateToProps, mapDispatchToProps)(InitModal)

export {
	ConnectedComponent as InitModal
}
